    false,nt"url": null,nt"notes": "The Audubon National Wildlife Refuge Complex
    Habitat Management Plan provides a long-term vision and specific guidance on managing
    habitats for the resources of concern at Audubon National Wildlife Refuge, Lake
    Nettie National Wildlife Refuge, McLean National Wildlife Refuge, and Audubon Wetland
    Management District, to facilitate continuity in management programs. Refuge background,
    resources of concern, and habitat management goals and objectives are discussed.
    Management strategies and prescriptions then identify how and the specific means
    by which management and monitoring strategies will be implemented. Environmental
    Assessment for the habitat management plan and appendices follow.",nt"license_title":
